import React ,{useState} from 'react'
import image1 from '../assets/image1.gif'
import '../styles/Contact.css'
function Contact(){
  const [state,setState]= useState({fname:"",email:"",message:""});

  const handleChange = e =>{
    const name=e.target.name;
    const value = e.target.value;
    setState({state,[name]:value});
  };

  const handleSubmit = e=>{
    alert(JSON.stringify(state));
  };

    return (
      <div className="contact">
        <div className="leftSide"
          style={{backgroundImage: `url(${image1})`}}>
        </div>
        <div
        className="rightSide">
        <h1> Contact  US </h1>
        <form id="contact-form">
          <label htmlFor="name">Full Name</label>
          <input name='fname' placeholder="enter your full name..." type="text" onChange={handleChange}/>
          <label htmlFor="email">Full Name</label>
          <input name='email' placeholder="enter your email..." type="text" onChange={handleChange}/>
          <label htmlFor="message">Full Name</label>
          <textarea
          rows="6"
          placeholder="Enter Message.."
          name="message"
          required onChange={handleChange} >
          </textarea>
          <button type="Submit" onClick={handleSubmit}>Send Message</button>
        </form>
        </div>
      </div>
    );
  }
  export default Contact
